[{"location":"#TrackedArray","page":"Home","title":"TrackedArray","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for TrackedArray.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#TrackedArray.PhysicalState","page":"Home","title":"TrackedArray.PhysicalState","text":"The PhysicalState may contain other properties, but those defined with TrackedVectors are used to compute the next event in the simulation.\n\n\n\n\n\n","category":"type"},{"location":"#TrackedArray.capture_state_changes-Tuple{Function, Any}","page":"Home","title":"TrackedArray.capture_state_changes","text":"capture_state_changes(f::Function, physical_state)\n\nThe callback function f will modify the physical state. This function records which parts of the state were modified. The callback should have no arguments and may return a result.\n\n\n\n\n\n","category":"method"},{"location":"#TrackedArray.capture_state_reads-Tuple{Function, Any}","page":"Home","title":"TrackedArray.capture_state_reads","text":"capture_state_reads(f::Function, physical_state)\n\nThe callback function f will read the physical state. This function records which parts of the state were read. The callback should have no arguments and may return a result.\n\n\n\n\n\n","category":"method"},{"location":"#TrackedArray.random_specification-Tuple{Any}","page":"Home","title":"TrackedArray.random_specification","text":"Creates a specification that looks like:\n\n    specification = [\n        :people => [\n            :health => Symbol,\n            :age => Int,\n            :location => Int\n        ]\n        :places => [\n            :name => String,\n            :population => Int\n        ]\n    ]\n\n\n\n\n\n","category":"method"},{"location":"#TrackedArray.spec_to_dict-Tuple{Any}","page":"Home","title":"TrackedArray.spec_to_dict","text":"Sample input:\n\n    specification = [\n        :people => [\n            :health => Symbol,\n            :age => Int,\n            :location => Int\n        ]\n        :places => [\n            :name => String,\n            :population => Int\n        ]\n    ]\n\n\n\n\n\n","category":"method"}]
